import "./App.css";

function App() {
  const age = 18;
  const isRed = true;
  return (
    <div className="App">
      {age >= 18 ? (
        <h1 style={{ color: isRed ? "red" : "yellow" }}> Overage </h1>
      ) : (
        <h1 style={{ color: "green" }}> Underage</h1>
      )}


    </div>


  );
}

export default App;
